import React from "react";
import styled from "styled-components";
export default function NavBar() {
  return (
    <Wrapper>
      <Logo>
        OCADU <br></br>
        STUDENT <br></br>
        PRESS
      </Logo>
    </Wrapper>
  );
}

const Wrapper = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  display: flex;
  width: 100vw;
  height: 150px;
  color: white;
  background: #ff5252;
`;

const Logo = styled.h1`
  font-family: urw-din-condensed, sans-serif;
  font-weight: 500;
  font-size: 1vw;
  line-height: 0.9em;
`;
